	$('.metamask.buynow').click(function(e) {
		e.preventDefault();
		if (typeof web3 === 'undefined') {
			swam('','You need to install MetaMask to use this feature.  https://metamask.io', 'error');
			return false;
		}
		var user_address;
		web3.eth.getAccounts(function(err, accounts){
			if (err != null) {
				console.error("An error occurred: "+err);
			}else if (accounts.length == 0) {
				swam('','You need to Login into MetaMask to use this feature.', 'error');			}else {
				user_address = accounts[0];
			}
		});
		var provider = web3.currentProvider;
		var metamask = new Web3( provider);
		var chainid = $(this).data('chainid');
		var amount = $(this).data('amount');
		var to = $(this).data('to');
		var mlink = $(this);
		console.log(chainid,amount,to);
		var user_address = web3.eth.accounts[0];
		metamask.eth.sendTransaction({
			to: to,
			from: user_address,
			value: web3.toWei(amount, 'ether'),
			chainId: chainid
		  }, function (err, transactionHash) {
			
			if (err){
				console.log(err.message);
				return swam('', 'Metamask Tx Failed Or Rejected.' , 'error');
			}
			var datam ={};
			datam.amount = amount;
			datam.token_id = mlink.data('token_id');
			datam.tx_hash = transactionHash;
			ajax_post(mlink, datam );
		  });
	});
	
	

